import React from 'react';
import {Button } from 'reactstrap';

function Nav() {
  return (
    <div>
      <Button color="danger"> Stage1 </Button>
      <Button color="danger"> Stage2 </Button>
      <Button color="danger"> Stage3 </Button>
      <Button color="danger"> Stage4 </Button>
      <Button color="danger"> Stage5 </Button>
    </div>
  );
}

export default Nav;
